import tkinter as tk
from tkinter import messagebox

activation_codes = {
    "IntelliJ IDEA": "FV8EM46DQYC5AW9---",
    "PyCharm": "GAJWL09BT5RSXDR---",
    "WebStorm": "1Z9RTLFFQRXP923---",
    "PhpStorm": "LK57VMVACTAYXFP---",
    "CLion": "I1EKS18DJA9M4KU---",
    "Rider": "0H5PC974JDMA7B0---",
    "DataGrip": "54H0PAD972IO7OS---",
    "RubyMine": "3PZMNOLHULXID52---",
    "GoLand": "BPTY4JK1CO0P29R---",
    "dotTrace": "K9XPIMUP26E1JZ6---",
    "dotMemory": "7VSJLWH79FAPTW5---",
    "dotCover": "U33CY7YUD9KWDFN---",
    "GoLand": "BPTY4JK1CO0P29R---",
    "Aqua": "OHARU4VVAG4GP0U---",
    "DataSpell": "S94DZMOA2LL6XZM---",
    "RustRover": "TRY38TEUMV07NQH---",
}

def copy_to_clipboard(product):
    code = activation_codes.get(product)
    if code:
        root.clipboard_clear() 
        root.clipboard_append(code) 
        messagebox.showinfo("Success", f"{product} activation code copied to clipboard")
    else:
        messagebox.showerror("Error", f"{product} code not found.")

root = tk.Tk()
root.title("Muxacode")
root.resizable(False, False)

window_width = 240
window_height = 300
screen_width = root.winfo_screenwidth()
screen_height = root.winfo_screenheight()

x_coordinate = int((screen_width / 2) - (window_width / 2))
y_coordinate = int((screen_height / 2) - (window_height / 2))
root.geometry(f"{window_width}x{window_height}+{x_coordinate}+{y_coordinate}")

canvas = tk.Canvas(root)
scrollbar = tk.Scrollbar(root, orient="vertical", command=canvas.yview)
scrollable_frame = tk.Frame(canvas)

scrollable_frame.bind(
    "<Configure>",
    lambda e: canvas.configure(scrollregion=canvas.bbox("all"))
)

canvas.create_window((0, 0), window=scrollable_frame, anchor="nw")
canvas.configure(yscrollcommand=scrollbar.set)

canvas.pack(side="left", fill="both", expand=True)
scrollbar.pack(side="right", fill="y")

label = tk.Label(scrollable_frame, text="JetBrains Activation Codes", font=("Helvetica", 14))
label.pack(pady=10)

button_frame = tk.Frame(scrollable_frame)
button_frame.pack(expand=True) 

for product in activation_codes.keys():
    button = tk.Button(button_frame, text=product, width=30, height=2, command=lambda p=product: copy_to_clipboard(p))
    button.pack(padx=5, pady=5)  # Buttons will be packed in the centered button frame

def on_mouse_wheel(event):
    canvas.yview_scroll(int(-1 * (event.delta // 120)), "units")

canvas.bind_all("<MouseWheel>", on_mouse_wheel)

if __name__ == "__main__":
    root.mainloop()
